import doctestdef inc(x: int, y: int) -> int:    '''    >>> inc(5, 0)    Traceback (most recent call last):        raise ValueError('Javob 0 chiqadi')    ValueError: Javob 0 chiqadi    >>> inc(4, 2)    2    >>> inc(9, -1)    -9    '''    if y == 0:        raise ValueError('Javob 0 chiqadi')    return x // y# inc(4, 8)if __name__ == '__main__':    doctest.testmod()